lunrIdx = lunr(function() {
  this.ref('id');
  this.field('name');

  this.metadataWhitelist = ['position'];

  data.forEach(function (doc) {
    this.add(doc)
  }, this);
});


//const userInput = 'CAM'; // OK
const userInput = 'COM'; // KO

let results = lunrIdx.search('*'+userInput+'*');


// Display results
let divCounter = document.createElement('div');
divCounter.textContent = `${results.length} results`;
document.body.appendChild(divCounter);

let ul = document.createElement('ul');
document.body.appendChild(ul);

results.forEach((result) => {
	let li = document.createElement('li');
  li.textContent = data.filter((dataEntry) => dataEntry.id === parseInt(result.ref, 10))[0].name
  ul.appendChild(li);
});
